import React from 'react';
import { TableHeading, StyledCart, StyledInfo, InfoFrame, Tag } from './StyledCart';
import tomato from '../../assets/tomato.jpg';

const ProductInfo = () => {
    return (
        <StyledInfo>
            <TableHeading>
                <p>Product</p>
                <p>Price</p>
                <p>Quantity</p>
                <p>Total</p>
            </TableHeading>
            <InfoFrame>
                <img src={tomato} alt="Pizza"/>
                <Tag>Basic pizza with ham</Tag>
            </InfoFrame>
        </StyledInfo>
    )
}

export default ProductInfo
